import React from 'react';

function List(props){

    return(

        <ul className='list-group'>

            {props.items.map(item =>    <li className='list-group-item' key={item.id}>
                                            {item.text}
                                            <button onClick={()=> props.onItemDeleted(item) }>Apagar</button>
                                        </li>)}

        </ul>

    );

};

export default List;
